INSERT INTO tm_afmeisyo(nmmaincd,nmsubcd,nmcd,nm,kananm,shortnm,biko,hanyokbn1,hanyokbn2,hanyokbn3) values('1000',47,'1','成人健（検）診予約日程事業',NULL,NULL,NULL,'2','①成人健（検）診予約日程事業を管理します。【設定例】「総合健診」「レディース検診」「健診フェスタ」など。②実施する「検診種別」「検査方法／内訳」を設定します。【設定例】「子宮がん」「乳がん（マンモ1／マンモ2／エコー）」など。※影響する機能　予約希望者管理（成人健（検）診日程）',NULL);
INSERT INTO tm_afmeisyo(nmmaincd,nmsubcd,nmcd,nm,kananm,shortnm,biko,hanyokbn1,hanyokbn2,hanyokbn3) values('1000',47,'2','その他予約日程事業・保健指導事業',NULL,NULL,NULL,'1','①その他予約日程事業・保健指導事業を管理します。【設定例】「母親学級」「リフレッシュヨガ教室」「心の相談」など。②「その他予約日程事業・保健指導事業」の業務・予約管理の有無、　保健指導の指導区分（訪問・相談・集団）を設定します。※影響する機能　予約希望者管理、保健指導管理、集団指導管理',NULL);
INSERT INTO tm_afmeisyo(nmmaincd,nmsubcd,nmcd,nm,kananm,shortnm,biko,hanyokbn1,hanyokbn2,hanyokbn3) values('1000',47,'3','保健指導・集団指導項目',NULL,NULL,NULL,'1','①保健指導管理、集団指導管理画面で管理する項目を追加・修正・削除します。【設定例】「指導目的」「指導内容」など。',NULL);
INSERT INTO tm_afmeisyo(nmmaincd,nmsubcd,nmcd,nm,kananm,shortnm,biko,hanyokbn1,hanyokbn2,hanyokbn3) values('1000',47,'4','成人健（検）診事業',NULL,NULL,NULL,'2','①成人健（検）診事業を管理します。【設定例】　「前立腺がん検診」「腹部超音波検査」「胃がんハイリスク検診」など。②成人健（検）診の検査方法／内訳を管理します。【設定例】「マンモのみ(1方向)」「マンモのみ(2方向)」「超音波」など。③成人健（検）診項目を管理します。【設定例】「マンモグラフィー検査判定」「エコー検査判定」「取込年月日」など。※影響する機能　受診情報管理、予約希望者管理',NULL);
INSERT INTO tm_afmeisyo(nmmaincd,nmsubcd,nmcd,nm,kananm,shortnm,biko,hanyokbn1,hanyokbn2,hanyokbn3) values('1000',47,'5','予防接種事業',NULL,NULL,NULL,'4','①予防接種事業を管理します。【設定例】　「接種情報生涯1回」、「罹患情報」、「接種依頼情報」など。②予防接種項目を管理します。【設定例】　「母子感染対象」、「内部障害」など。※影響する機能　予防接種情報管理',NULL);
